snippet.textDisplay:
Akbar Ali, I love you. Gul Muhammad, I love you. Sir Aamir Zaki...Why did you have to leave? The song needed more of Zaki and less of Javed bashir. The song was well paced as it is and just Akbar ali and the ensemble would have been enough. I would revisit the song a hundred times just for Akbar Ali, Gul Muhammad and Aamir Zaki. Rightfully, Aamir sitting aloof and alone but...on top! A brilliant brilliant song and a fitting tribute to the one that Ustad Bade Ghulam ali sahab sang decades ago

Love, lots of love from India

@Rohwit

